import React from 'react';
import './GoodsItems.css';


const goodsItem = () => {
    return (
        <header>
            <img src="https://source.unsplash.com/random/150x200" className="itemsImg" />
            <div class="navigation-items">
                <ul>
                    <li>상품목록</li>
                    <li>장바구니</li>
                </ul>
            </div>
        </header>
    )
}

export default goodsItem;
